  [],\n\t\"title\": \"Fisheries-Independent Biological and Environmental Trawl Data
  from the Louisiana Department of Wildlife and Fisheries (1986-2007) as Part of the
  Comparative Assessment of Gulf Estuarine Systems (CAGES) Database (NODC Accession
  0115183)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-09-26T23:43:02.310320\",\n\t\"name\":
  \"fisheries-independent-biological-and-environmental-trawl-data-from-the-louisiana-department-of-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The CAGES program (Comparative Assessment
  of Gulf Estuarine Systems) is designed to examine the differences between estuarine
  ecosystems and investigate why some are more productive than others. The program
  focuses on estuarine areas important to commercial fisheries and includes data on
  commercial finfish and invertebrate species, as well as other species commonly captured
  in trawl sampling. This Louisiana dataset is a subset of the CAGES Relational Database
  which is a compilation of fishery-independent data contributed by natural resource
  agencies of the Gulf States (Texas, Louisiana, Mississippi, Alabama, and Florida).
  This data set includes data from trawls collected by the Marine Fisheries Division
  of the Louisiana Department of Wildlife and Fisheries (LDWF), as well as associated
  hydrographic data. Trawl data were used to calculate CPUE (catch per unit effort)
  at each station for the years 1986 through 2007.\",\n\t\"license_title\": null,\n\t\"extras\":
